import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <section className="hero-section">
        <div className="hero-content">
          <div className="text-content">
            <h1 className="hero-title">Welcome To Farmers Helpline.</h1>
            <p className="hero-description">
              Discover amazing products, services, and more. Start your journey with us today!
            </p>
            <button className="cta-button">Learn More</button>
          </div>
          <div className="image-content">
            <img
              src="Farmer with hoe.jpg" // Replace with your own image
              alt="Hero Image"
              className="hero-image"
            />
          </div>
        </div>
      </section>
    </div>
  );
};

export default App;
